import schedule
import time
import pystray
from PIL import Image
import io
import base64
import os
import sys
from plyer import notification
from datetime import datetime
import tempfile  # For creating a temporary file

# This is the Base64-encoded version of your .ico file
icon_base64 = """

"""
# Paste the Base64 string here

# Function to create an image from the base64 string
def get_icon_image():
    icon_data = base64.b64decode(icon_base64)
    image = Image.open(io.BytesIO(icon_data))  # Create an image object from the Base64 data
    return image

# Function to save the icon as a temporary .ico file
def save_temp_icon():
    temp_icon_path = os.path.join(tempfile.gettempdir(), "temp_drink_water.ico")
    image = get_icon_image()
    image.save(temp_icon_path, format='ICO')  # Save the icon as an .ico file
    return temp_icon_path

# Function to send the water reminder notification
def drink_water_reminder():
    # Get the current time
    current_time = datetime.now().strftime("%I:%M %p")
    
    # Save the icon to a temporary file and use it in the notification
    icon_path = save_temp_icon()
    
    # Create the notification
    notification.notify(
        title="Drink Water Reminder",
        message=f"It's {current_time} - Time to drink water!",
        app_icon=icon_path,  # Use the temporary icon file
        timeout=10
    )

# Function to schedule the reminders
def schedule_reminders():
    for hour in range(10, 20):  # 10 AM to 7 PM
        schedule.every().day.at(f"{hour:02d}:00").do(drink_water_reminder)

# Function to handle system tray icon clicks
def on_right_click(icon, item):
    if item.text == "End Task":
        icon.stop()
        os._exit(0)  # Exit the script cleanly
    elif item.text == "Show Notification":
        drink_water_reminder()

# Create the system tray icon
def create_system_tray_icon():
    image = get_icon_image()  # Use the icon from memory
    menu = pystray.Menu(
        pystray.MenuItem("End Task", on_right_click),
        pystray.MenuItem("Show Notification", on_right_click),
    )
    icon = pystray.Icon("Water Reminder", image, "Water Reminder", menu=menu)
    return icon

if __name__ == "__main__":
    schedule_reminders()
    
    print("Water reminder script is running. Keep this window open.")
    print("Press Ctrl+C to stop the script.")

    # Create and start the system tray icon in a separate thread
    import threading
    tray_icon = create_system_tray_icon()
    tray_icon_thread = threading.Thread(target=tray_icon.run)
    tray_icon_thread.daemon = True
    tray_icon_thread.start()

    try:
        while True:
            schedule.run_pending()
            time.sleep(1)
    except KeyboardInterrupt:
        print("\nScript stopped.")
        tray_icon.stop()